import React from "react";
import Particles from "react-particles-js";

class parts extends React.Component {
  render() {
    return (
      <div>
        <Particles
          height="100vh"
          style={{opacity: "0.8", position: "absolute"}}
          params={{
            particles: {
              number: {
                value: 50
              },
              move: {
                direction: "random",
                speed: 2
              },
              size: {
                value: 3
              }
            },
            interactivity: {
              events: {
                onhover: {
                  enable: true,
                  mode: "repulse"
                }
              }
            }
          }}
        />
      </div>
    );
  }
}

export default parts;
